/** @format */

import React from 'react';
import '../App.css';
import { HealthList } from '../TextInfo';
import HealthBlock from '../components/HealthBlock';
import Swipe from '../components/Swipe';

const Health = () => {
    return (
        <div className='container_page'>
            <div className='filler-text'>
                <h1 className='title_exp'>You are what you eat</h1>
                <p>
                    Chef Yannick worked aside with Mandy Wong, qualify nutritionist based in Sodexo Hong Kong, achieving a pallet of healthy eating programs</p>
            </div>
            <div className='container_exp'>
                <span className='hth_li supplier'>
                    {HealthList.map( ( item, index ) => {
                        return (
                            index % 2 == 0 ?
                                ( <span key={index} className="healthCard">
                                    <span className='health_block'>
                                        <div className='exp_location_img'>
                                            <span className="healthSwiperImages">
                                                <div className='wrapper'>
                                                    <div className='main_wrapper'>
                                                        <Swipe for="health" idx={item.img} />
                                                    </div>
                                                </div>
                                            </span>
                                        </div>
                                        <span className='hth_header_left'>
                                            <h3 className='exp_position'>{item.title}</h3>
                                            <p>{item.subtitle}</p>
                                        </span>
                                    </span>
                                </span> )
                                :
                                ( <span className='health_block'>
                                    <span className='hth_header_right'>
                                        <h3 className='exp_position'>{item.title}</h3>
                                        <p>{item.subtitle}</p>
                                    </span>
                                    <div className='exp_location_img'>
                                        <span className="healthSwiperImages">
                                            <div className='wrapper'>
                                                <div className='main_wrapper'>
                                                    <Swipe for="health" idx={item.img} />
                                                </div>
                                            </div>
                                        </span>
                                    </div>
                                </span> )
                        );
                    } )}
                </span>
            </div>
        </div>
    );
};

export default Health;
